import React, { Component } from 'react';
import './App.css';

class App extends Component{

  constructor(props){
    super(props);
    this.state={
      couses:[]
    }
  }


  render(){
    return (
      <div className="App">
        <ul className="course-list">
          <li className="course">
            <div>Java</div>
          </li>
        </ul>
      </div>
    );
  }
}

export default App;
